$this->registerJs(
    "$(document).ready(function() {
    var param = $('meta[name=csrf-param]').attr('content');
    var token = $('meta[name=csrf-token]').attr('content');
    var panels = $('.vote-results');
    var panelsButton = $('.dropdown-results');
    panels.hide();

    //Click dropdown
    panelsButton.click(function() {
    
        //get data-for attribute
        var dataFor = $(this).attr('data-for');
        var idFor = $(dataFor);

        //current button
        var currentButton = $(this);
        idFor.slideToggle(400, function() {
            //Completed slidetoggle
            if(idFor.is(':visible'))
            {
                currentButton.html('Hide Results');
            }
            else
            {
                currentButton.html('View Results');
            }
        })
    });
    $(document).on('click', '#vote-button', function(e){
        $.ajax({
            url: 'vote/request/listvote',
            type: 'get',
            dataType: 'json',
            success: function(data, response, textStatus, jqXHR) {
                 
                if (data.status === 1) {
                var vote = data['vote'];
                   $('#voteLabel').html(vote);
                   var content = '';
                        for(var i in data['answers']){
                         var answer = data['answers'][i].answer;
                         var id = data['answers'][i].id;
                        content += '<li class=\"list-group-item\"><div class=\"radio\"><label><input class=\"vote-check\" type=\"radio\" name=\"vote-radio\" value=\"'+id+'\">'+answer+'</label></div></li>'
                        }
                        $('#answers-variant').html(content);
                }else {
                    
                }
            }
        });
        return false;
    });
    $(document).on('click', '#vote-submit', function(e){
        
        var form = $('.vote-check:checked').val();
        $.ajax({
            url: 'vote/request/vote',
            type: 'post',
            dataType: 'json',
            data: {'selected': form, 'param': token},
            success: function(data, response, textStatus, jqXHR) {
           if(data['status'] === 1){
           $('#answers-variant').html(' ');
           $('#vote-accept').show();
              
           }else{
                    alert('Your vote not accepted!');
                }           
           }
        });
        return false;
    });
    
});

",
    \yii\web\View::POS_READY,
    'my-button-handler'
);

